import React from 'react';
import { Brain, Layers, Search, MessageSquare, Activity } from 'lucide-react';
import './AIServices.css';

const aiServices = [
  {
    icon: <Brain size={28} />,
    title: 'AI-Powered Job Matching',
    description: 'Connect freelancers with perfect jobs using smart matching algorithms.',
  },
  {
    icon: <Layers size={28} />,
    title: 'Portfolio Analysis',
    description: 'Analyze and score resumes or portfolios using machine learning models.',
  },
  {
    icon: <Search size={28} />,
    title: 'Smart Search',
    description: 'Use NLP-based smart search to find talent, skills, or projects easily.',
  },
  {
    icon: <MessageSquare size={28} />,
    title: 'AI Chat Support',
    description: '24/7 AI chatbot to help users, answer questions, and assist in tasks.',
  },
  {
    icon: <Activity size={28} />,
    title: 'Pricing Suggestion',
    description: 'ML models to suggest competitive pricing for freelancers and clients.',
  }
];

const AIServices = () => {
  return (
    <section className="ai-section">
      <div className="ai-header">
        <h2>AI & Machine Learning Services</h2>
        <p>Supercharge your freelance platform with intelligent automation and smart insights.</p>
      </div>

      <div className="ai-grid">
        {aiServices.map((service, index) => (
          <div className="ai-card" key={index}>
            <div className="ai-icon">{service.icon}</div>
            <h3>{service.title}</h3>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default AIServices;
